	(345, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '36', 'user_action', NULL, NULL, false, '{"id": 36, "name": "Task List Usage", "unit": null, "active": true, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the percentage of completed work orders which had a Task List attached. A large percentage of work orders with Task Lists attached indicates that Work Management can produce quality work orders with predetermined resources, materials and documents.", "created_at": "2025-09-08T04:19:48.091485+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:48.091485+00:00", "calculation": "Task List Utilisation = All completed Work Orders / All completed Work Orders with Task List", "description": "Total Work orders completed in previous 12 months that has utilised a task list for work planning over the same period.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 36, "name": "Task List Usage", "unit": null, "active": true, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the percentage of completed work orders which had a Task List attached. A large percentage of work orders with Task Lists attached indicates that Work Management can produce quality work orders with predetermined resources, materials and documents.", "created_at": "2025-09-08T04:19:48.091485+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:48.091485+00:00", "calculation": "Task List Utilisation = All completed Work Orders / All completed Work Orders with Task List", "description": "Total Work orders completed in previous 12 months that has utilised a task list for work planning over the same period.", "calculation_type": "ratio", "required_csv_columns"