	(348, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '40', 'user_action', NULL, NULL, false, '{"id": 40, "name": "Notification Close Out Quality", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the percentage of notifications completed with all required information. Accurate recording of maintenance history enables analysis for productivity and efficiency improvements.", "created_at": "2025-09-08T04:19:49.371284+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:49.371284+00:00", "calculation": "Notification Close Out Quality = Quality Closed Out Notifications / All Notifications Closed", "description": "A ratio of all completed quality work orders/notifications against all work orders. A quality notification closed is when all the below criteria is completed:\\nDamage Code\\nCause Code\\nSystem Code\\nComponent Code", "calculation_type": "ratio", "required_csv_columns": [{"name": "cause_code", "data_type": "string", "description": null}, {"name": "component_code", "data_type": "string", "description": null}, {"name": "damage_code", "data_type": "string", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "notification_status", "data_type": "string", "description": null}, {"name": "system_code", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}]}', '{"id": 40, "name": "Notification Close Out Quality", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the percentage of notifications completed with all required information. Accurate recording of maintenance history enables analysis for productivity and efficiency improvements.", "created_at": "2025-09-08T04:19:49.371284+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:49.371284+00:00", "calculation": "Notifi