	(357, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '51', 'user_action', NULL, NULL, false, '{"id": 51, "name": "Planned Equipment Availability (Future)", "unit": null, "active": false, "provider": "other", "max_value": null, "min_value": null, "objective": "To view how maintenance work in the future integrates with the operation plans which is reflected by predicting availability of equipment after scheduled maintenance.", "created_at": "2025-09-08T04:19:52.670788+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.670788+00:00", "calculation": "Equipment Availability = (Calendar Time - Total Hours Future Work Orders) / Calendar Time", "description": "The percentage of calendar time that assets are physically available for work. Calendar time 1440 mins per day and all measurements are to be taken over same period", "calculation_type": "ratio", "required_csv_columns": [{"name": "asset_id", "data_type": "string", "description": null}, {"name": "calendar_time", "data_type": "number", "description": null}, {"name": "total_hours_future_work_orders", "data_type": "number", "description": null}]}', '{"id": 51, "name": "Planned Equipment Availability (Future)", "unit": null, "active": false, "provider": "other", "max_value": 1, "min_value": 0, "objective": "To view how maintenance work in the future integrates with the operation plans which is reflected by predicting availability of equipment after scheduled maintenance.", "created_at": "2025-09-08T04:19:52.670788+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.670788+00:00", "calculation": "Equipment Availability = (Calendar Time - Total Hours Future Work Orders) / Calendar Time", "description": "The percentage of calendar time that assets are physically available for work. Calendar time 1440 mins per day and all measurements are to be taken over same period", "calculation_type": "ratio", "required_csv_columns": [{"name": "asset_id", "data