	(372, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '48', 'user_action', NULL, NULL, false, '{"id": 48, "name": "Notification Priority Age", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To understand the assessment of notification priorities and to how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.", "created_at": "2025-09-08T04:19:51.7407+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:51.7407+00:00", "calculation": "Notification Priority = Total Notification Age by Priority / Count of Notifications by Priority", "description": "A summation of notifications age per priority type divided by the count of notifications per priority type.", "calculation_type": "average", "required_csv_columns": [{"name": "close_date", "data_type": "date", "description": null}, {"name": "creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "priority", "data_type": "string", "description": null}]}', '{"id": 48, "name": "Notification Priority Age", "unit": null, "active": false, "provider": "SAP", "max_value": 9999, "min_value": 0, "objective": "To understand the assessment of notification priorities and to how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.", "created_at": "2025-09-08T04:19:51.7407+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:51.7407+00:00", "calculation": "Notification Priority = Total Notification Age by Priority / Count of Notifications by Priority", "description": "A summation of notifications age per priority type divided by the count of notifications per priority type.", "calculation_type": "average