	(373, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '49', 'user_action', NULL, NULL, false, '{"id": 49, "name": "Work Order Priority Age", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view how prioritisation of work for planning and scheduling is completed using work order priorities and to observe how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.", "created_at": "2025-09-08T04:19:52.047271+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.047271+00:00", "calculation": "Work Order Priority = Total Work Order Age by Priority / Count of Work Orders by Priority", "description": "A summation of work orders age per priority type divided by the count of work orders per priority type.", "calculation_type": "average", "required_csv_columns": [{"name": "close_date", "data_type": "date", "description": null}, {"name": "creation_date", "data_type": "date", "description": null}, {"name": "priority", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 49, "name": "Work Order Priority Age", "unit": null, "active": false, "provider": "SAP", "max_value": 9999, "min_value": 0, "objective": "To view how prioritisation of work for planning and scheduling is completed using work order priorities and to observe how well we are managing the workload. Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operation requirements.", "created_at": "2025-09-08T04:19:52.047271+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.047271+00:00", "calculation": "Work Order Priority = Total Work Order Age by Priority / Count of Work Orders by Priority", "description": "A summation of work orders age per prior