	(374, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '58', 'user_action', NULL, NULL, false, '{"id": 58, "name": "Effective Labour Rate", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the effect of internal labour cost per hour for maintenance work and to benchmark this across depots and compare against budget.", "created_at": "2025-09-08T04:19:54.737611+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.737611+00:00", "calculation": "Effective Labour Rate = Total All Costs / Total All Time Confirmations", "description": "The total of all direct and indirect labour costs is divided by all work order hours confirmed over the same period.", "calculation_type": "average", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "labour_cost", "data_type": "number", "description": null}, {"name": "time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 58, "name": "Effective Labour Rate", "unit": null, "active": false, "provider": "SAP", "max_value": 9999, "min_value": 0, "objective": "To view the effect of internal labour cost per hour for maintenance work and to benchmark this across depots and compare against budget.", "created_at": "2025-09-08T04:19:54.737611+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.737611+00:00", "calculation": "Effective Labour Rate = Total All Costs / Total All Time Confirmations", "description": "The total of all direct and indirect labour costs is divided by all work order hours confirmed over the same period.", "calculation_type": "average", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "labour_cost", "data_type": "number", "description": null}, {"name": "time_confirmation_hours", "data_type