	(375, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '59', 'user_action', NULL, NULL, false, '{"id": 59, "name": "Material Management (Future)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the effectiveness and management of materials not used on work orders through the timeliness for return.", "created_at": "2025-09-08T04:19:54.997859+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.997859+00:00", "calculation": "Material Management = Sum(Return Material Date - Work Order Completion Date) / Total Count Material Returns", "description": "All work orders with a return material movement on a work order captures the date the material was returned compared to the work order completion and then averaged in days.", "calculation_type": "average", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "return_material_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 59, "name": "Material Management (Future)", "unit": null, "active": false, "provider": "SAP", "max_value": 9999, "min_value": 0, "objective": "To view the effectiveness and management of materials not used on work orders through the timeliness for return.", "created_at": "2025-09-08T04:19:54.997859+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:54.997859+00:00", "calculation": "Material Management = Sum(Return Material Date - Work Order Completion Date) / Total Count Material Returns", "description": "All work orders with a return material movement on a work order captures the date the material was returned compared to the work order completion and then averaged in days.", "calculation_type": "average", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "return_material_date", "dat