	(449, 'b64d182f-0ee3-40a0-b367-281f31902620', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_question_rating_scales', '122', 'user_action', NULL, NULL, false, '{"id": 122, "company_id": "b64d182f-0ee3-40a0-b367-281f31902620", "created_at": "2025-11-06T02:11:33.030413+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-06T02:11:33.030413+00:00", "description": "Ad-hoc approach with minimal processes, responding to issues as they occur", "questionnaire_id": 4, "questionnaire_question_id": 26, "questionnaire_rating_scale_id": 13}', '{"id": 122, "company_id": "b64d182f-0ee3-40a0-b367-281f31902620", "created_at": "2025-11-06T02:11:33.030413+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-06T02:15:47.652+00:00", "description": "Checklists are poorly designed and incomplete and do not exist for all critical equipment. Operations verbally notify AM personnel.", "questionnaire_id": 4, "questionnaire_question_id": 26, "questionnaire_rating_scale_id": 13}', '{description}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-06 02:15:47.690623+00'),
	(450, 'b64d182f-0ee3-40a0-b367-281f31902620', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_question_rating_scales', '123', 'user_action', NULL, NULL, false, '{"id": 123, "company_id": "b64d182f-0ee3-40a0-b367-281f31902620", "created_at": "2025-11-06T02:11:33.030413+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-06T02:11:33.030413+00:00", "description": "Basic processes and planning established, but implementation is inconsistent", "questionnaire_id": 4, "questionnaire_question_id": 26, "questionnaire_rating_scale_id": 14}', '{"id": 123, "company_id": "b64d182f-0ee3-40a0-b367-281f31902620", "created_at": "2025-11-06T02:11:33.030413+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-06T02:15:58.639+00:00", "description": "Checklists are good quality and up to date but not using a standard design. Exist for all critical equipment. Operations Supervisor enter Notifications in SAP. Maintenance Supervisors approve Notifications for Work Order creation.", "questionnaire_id": 4, "questionnaire_question_id": 26, "questionnaire_rating_scale_id": 14}', '{description}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-06 02:15:58.646184+00'),
