	(116, '2025-11-04 00:33:47.30929+00', '2025-11-04 00:34:13.293+00', '00000000-0000-0000-0000-000000000001', 24, 11, 'Comprehensive audit program covering all ISO 55001 requirements. Trained auditors.', NULL, false, 3, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(117, '2025-11-04 00:33:47.30929+00', '2025-11-04 00:34:19.805+00', '00000000-0000-0000-0000-000000000001', 24, 12, 'Risk-based audit approach with continuous monitoring and real-time compliance tracking.', NULL, false, 3, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(118, '2025-11-06 01:51:26.000425+00', '2025-11-06 01:52:14.051+00', '00000000-0000-0000-0000-000000000001', 25, 13, 'Training recipients identified but less than 25% trained.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(119, '2025-11-06 01:51:26.000425+00', '2025-11-06 01:52:18.323+00', '00000000-0000-0000-0000-000000000001', 25, 14, 'Training recipients identified but less than 50% trained and most emergent work is incorrectly coded.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(120, '2025-11-06 01:51:26.000425+00', '2025-11-06 01:52:23.103+00', '00000000-0000-0000-0000-000000000001', 25, 15, '75% of people trained and most emergent work is correctly coded.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(121, '2025-11-06 01:51:26.000425+00', '2025-11-06 01:52:28.245+00', '00000000-0000-0000-0000-000000000001', 25, 16, '90% of people trained and all emergent work is correctly coded.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(122, '2025-11-06 02:11:33.030413+00', '2025-11-06 02:15:47.652+00', '00000000-0000-0000-0000-000000000001', 26, 13, 'Checklists are poorly designed and incomplete and do not exist for all critical equipment. Operations verbally notify AM personnel.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(123, '2025-11-06 02:11:33.030413+00', '2025-11-06 02:15:58.639+00', '00000000-0000-0000-0000-000000000001', 26, 14, 'Checklists are good quality and up to date but not using a standard design. Exist for all critical equipment. Operations Supervisor enter Notifications in SAP. Maintenance Supervisors approve Notifications for Work Order creation.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(124, '2025-11-06 02:11:33.030413+00', '2025-11-06 02:16:03.455+00', '00000000-0000-0000-0000-000000000001', 26, 15, 'Checklists based on a standard template and exist for the majority of equipment. All Notifications are entered in the SAP.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620'),
	(125, '2025-11-06 02:11:33.030413+00', '2025-11-06 02:16:14.054+00', '00000000-0000-0000-0000-000000000001', 26, 16, 'Checklists periodically reviewed and exist for all equipment as identified through Asset Tactics Development.  All operations personnel enter Notifications in SAP, and reviewed for rejected or additional info, and resubmit as needed.', NULL, false, 4, 'b64d182f-0ee3-40a0-b367-281f31902620');
